import './App.css'
import { useEffect, useState } from 'react'
import PlayedList from './component/PlayedList'

function App() {
	const [songs, setSongs] = useState([])

	useEffect(() => {
		// Функция для получения данных с бэкенда
		const fetchData = async () => {
			try {
				const response = await fetch('127.0.0.1:3001/api/songs')
				const data = await response.json()
				setSongs(data)
			} catch (error) {
				console.log('Error fetching data:', error)
			}
		}

		// Вызываем функцию при монтировании компонента
		fetchData()
	}, []) // Пустой массив зависимостей гарантирует, что эффект выполняется только один раз при монтировании
	const click = item => {
		console.log(item)
	}
	return (
		<div className='App'>
			<div id='player'>
				<div id='song-title'>Now Playing: Song Title</div>

				<div id='controls'>
					<button>Previous</button>
					<button>Play</button>
					<button>Next</button>
				</div>
			</div>
			<PlayedList items={songs} click={click} />
		</div>
	)
}

export default App
